INSERT INTO `policy_and_privices` VALUES (1,'\"<h4 class=\\\"card-title\\\">Пользовательское соглашение при использовании сайта</h4>\\r\\n<p>1. Общие положения<br>1.1. Настоящее Пользовательское соглашение (далее &mdash; Соглашение) относится к сайту, расположенному по адресу https://one-team.pro/.<br>1.2. Соглашение регулирует отношения между Администрацией сайта и Пользователем данного Сайта.<br>1.3. Администрация сайта оставляет за собой право в любое время изменять, добавлять или удалять пункты настоящего Соглашения без уведомления Пользователя.<br>1.4. Пользователь несет персональную ответственность за проверку настоящего Соглашения на наличие изменений в нем.<br>1.5. Использование Сайта Пользователем означает принятие Соглашения и изменений, внесенных в настоящее Соглашение в полном объеме, без всяких оговорок и исключений.<br>1.6. В случае несогласия Пользователя с Соглашением или его изменениями, он обязан прекратить использование сервисов Сайта https://one-team.pro/.<br>2. Определения терминов<br>2.1. Перечисленные ниже термины имеют для целей настоящего Соглашения следующее значение:<br>2.1.1. &laquo;Сайт&raquo; &mdash; Интернет ресурс, расположенный на доменном имени https://one-team.pro/, осуществляющий свою деятельность посредством Интернет-ресурса и сопутствующих ему сервисов.<br>2.1.1. &laquo;Администрация cайта&raquo; &mdash; уполномоченные сотрудники на управление Сайтом, которые организуют и (или) осуществляет обработку персональных данных, а также определяет цели обработки персональных данных, состав персональных данных, подлежащих обработке, действия (операции), совершаемые с персональными данными.<br>2.1.2. &laquo;Пользователь cайта&raquo; (далее &mdash; Пользователь) &mdash; лицо, имеющее доступ к Сайту, посредством сети Интернет и использующее Сайт.<br>3. Предмет соглашения<br>3.1. Предметом настоящего Соглашения является предоставление Пользователю доступа к содержащейся на Сайте информации и/или оказываемым услугам.<br>3.2. Под действие наст