ых систем и за задержки связанные с их работой.<br>7. Разрешение споров<br>7.1. В случае возникновения любых разногласий или споров между Сторонами настоящего Соглашения обязательным условием до обращения в суд является предъявление претензии (письменного предложения о добровольном урегулировании спора).<br>7.2. Получатель претензии в течение 30 календарных дней со дня ее получения, письменно уведомляет заявителя претензии о результатах рассмотрения претензии.<br>7.3. При невозможности разрешить спор в добровольном порядке любая из Сторон вправе обратиться в суд за защитой своих прав, которые предоставлены им действующим законодательством Российской Федерации.<br>8. Дополнительные условия<br>8.1. Все предложения или вопросы по настоящему Соглашению следует направлять на электронную почту info@one-team.pro.</p>\"','\"<p>en<\\/p>\"','\"<p>tr<\\/p>\"','\"<h4 class=\\\"card-title\\\">Политика в отношении обработки персональных данных</h4>\\r\\n<div class=\\\"tox-promotion\\\">\\r\\n<p>1. Общие положения<br>Настоящая политика обработки персональных данных составлена в соответствии с требованиями Федерального закона от 27.07.2006. № 152-ФЗ &laquo;О персональных данных&raquo; (далее &mdash; Закон о персональных данных) и определяет порядок обработки персональных данных и меры по обеспечению безопасности персональных данных, предпринимаемые Oneteam (далее &mdash; Оператор).<br>1.1. Оператор ставит своей важнейшей целью и условием осуществления своей деятельности соблюдение прав и свобод человека и гражданина при обработке его персональных данных, в том числе защиты прав на неприкосновенность частной жизни, личную и семейную тайну.<br>1.2. Настоящая политика Оператора в отношении обработки персональных данных (далее &mdash; Политика) применяется ко всей информации, которую Оператор может получить о посетителях веб-сайта https://one-team.pro.<br>2. Основные понятия, используемые в Политике<br>2.1. Автоматизированная обработка персональных данных &mdash; обработка персональных данных с помощью средств вычислительной техники.<br>2.2. Блокирование персональных данных &mdash; временное прекращение обработки персональных данных (за исключением случаев, если обработка необходима для уточнения персональных данных).<br>2.3. Веб-сайт &mdash; совокупность графических и информационных материалов, а также программ для ЭВМ и баз данных, обеспечивающих их доступность в сети интернет по сетевому адресу https://one-team.pro.<br>2.4. Информационная система персональных данных &mdash; совокупность содержащихся в базах данных персональных данных и обеспечивающих их обработку информационных технологий и технических средств.<br>2.5. Обезличивание персональных данных &mdash; действия, в результате которых невозможно определить без использования дополнительной информации принадлежность персональных данных конкретному Пользователю или иному субъекту персональных данных.<br>2.6. Обработка персональных данных &mdash; любое действие (операция) или совокупность действий (операций), совершаемых с использованием средств автоматизации или без использования таких средств с персональными данными, включая сбор, запись, систематизацию, накопление, хранение, уточнение (обновление, изменение), извлечение, использование, передачу (распространение, предоставление, доступ), обезличивание, блокирование, удаление, уничтожение персональных данных.<br>2.7. Оператор &mdash; государственный орган, муниципальный орган, юридическое или физическое лицо, самостоятельно или совместно с другими лицами организующие и/или осуществляющие обработку персональных данных, а также определяющие цели обработки персональных данных, состав персональных данных, подлежащих обработке, действия (операции), совершаемые с персональными данными.<br>2.8. Персональные данные &mdash; любая информация, относящаяся прямо или косвенно к определенному или определяемому Пользователю веб-сайта https://one-team.pro.<br>2.9. Персональные данные, разрешенные субъектом персональных данных для распространения, &mdash; персональные данные, доступ неограниченного круга лиц к которым предоставлен субъектом персональных данных путем дачи согласия на обработку персональных данных, разрешенных субъектом персональных данных для распространения в порядке, предусмотренном Законом о персональных данных (далее &mdash; персональные данные, разрешенные для распространения).<br>2.10. Пользователь &mdash; любой посетитель веб-сайта https://one-team.pro.<br>2.11. Предоставление персональных данных &mdash; действия, направленные на раскрытие персональных данных определенному лицу или определенному кругу лиц.<br>2.12. Распространение персональных данных &mdash; любые действия, направленные на раскрытие персональных данных неопределенному кругу лиц (передача персональных данных) или на ознакомление с персональными данными неограниченного круга лиц, в том числе обнародование персональных данных в средствах массовой информации, размещение в информационно-телекоммуникационных сетях или предоставление доступа к персональным данным каким-либо иным способом.<br>2.13. Трансграничная передача персональных данных &mdash; передача персональных данных на территорию иностранного государства органу власти иностранного государства, иностранному физическому или иностранному юридическому лицу.<br>2.14. Уничтожение персональных данных &mdash; любые действия, в результате которых персональные данные уничтожаются безвозвратно с невозможностью дальнейшего восстановления содержания персональных данных в информационной системе персональных данных и/или уничтожаются материальные носители персональных данных.<br>3. Основные права и обязанности Оператора<br>3.1. Оператор имеет право:<br>&mdash; получать от субъекта персональных данных достоверные информацию и/или документы, содержащие персональные данные;<br>&mdash; в случае отзыва субъектом персональных данных согласия на обработку персональных данных, а также, направления обращения с требованием о прекращении обработки персональных данных, Оператор вправе продолжить обраб