 – 40 км, Расстояние до моря составляет 3 км','2 km from the center of Alanya.Distance from Antalya International Airport to Avsallar is 130 km, from Gazipasa International Airport - 40 km. The distance to the sea is 3 km','Alanya merkeze 2 km. uzaklıkta olan Avsallar\'ın Antalya Uluslararası Havalimanı\'na uzaklığı 130 km, Gazipaşa Uluslararası Havalimanı\'na uzaklığı ise 40 km\'dir. Denize uzaklığı 3 km\'dir','2023-07-30 11:12:13','2023-10-16 17:41:33','Да','Да','Да','Да','Да','Да','[{\"id\": \"0\", \"size\": \"44,5\", \"floor\": \"цокольный, 1, 2\", \"price\": 150006, \"building\": \"Блок А\", \"price_code\": \"EUR\", \"apartment_layout\": \"1+1\", \"apartment_layout_image\": \"510bc6598a26f3df41ae39b617cdefe4.jpg\"}, {\"id\": \"1\", \"size\": \"69,5\", \"floor\": \"цокольный, 1, 2\", \"price\": 200005, \"building\": \"Блок А\", \"price_code\": \"EUR\", \"apartment_layout\": \"2+1\", \"apartment_layout_image\": \"7eb4a9a85292566f37cdddef66bce84c.jpg\"}, {\"id\": \"2\", \"size\": \"82\", \"floor\": \"3\", \"price\": 250000, \"building\": \"Блок А\", \"price_code\": \"EUR\", \"apartment_layout\": \"2+1 duplex\", \"apartment_layout_image\": \"a7b0cf64d7a8a133b3f11e779d4f5be6.jpg\"}, {\"id\": \"3\", \"size\": \"152\", \"floor\": \"3\", \"price\": 300000, \"building\": \"Блок А\", \"price_code\": \"EUR\", \"apartment_layout\": \"3+1 duplex\", \"apartment_layout_image\": \"bed6e918d3d53e4c400fab308713b27a.jpg\"}, {\"id\": \"4\", \"size\": \"44,5\", \"floor\": \"цокольный, 1, 2\", \"price\": 150000, \"building\": \"Блок B\", \"price_code\": \"EUR\", \"apartment_layout\": \"1+1\", \"apartment_layout_image\": \"079ae6cfdcc99237a4a5038ee2aa0a58.jpg\"}, {\"id\": \"5\", \"size\": \"104,5\", \"floor\": \"цокольный, 1, 2\", \"price\": 250000, \"building\": \"Блок B\", \"price_code\": \"EUR\", \"apartment_layout\": \"2+1\", \"apartment_layout_image\": \"3dca20f637514f0f2c6766bf6acb42f6.jpg\"}, {\"id\": \"6\", \"size\": \"86,5\", \"floor\": \"3\", \"price\": 300000, \"building\"